import { Component, OnInit } from '@angular/core';
import { DataService } from '../../services/data.service';

@Component({
  selector: 'app-statistics',
  templateUrl: './statistics.component.html',
  styleUrls: ['./statistics.component.css']
})
export class StatisticsComponent implements OnInit {

  constructor(private dataService: DataService) { }

  ngOnInit(): void {
    // TODO: fetch chart data
    this.dataService.getChartData().subscribe({
      next: (data) => {
        console.log('Chart data:', data);
        // TODO: update chart with data
      },
      error: (error) => {
        console.error('Error fetching chart data:', error);
      }
    });
  }
}
<div class="statistics-container">
  <div class="container">
    <h1>Statistics</h1>
    
    <div class="statistics-grid">
      <div class="statistics-card">
        <h2>Target Detection Trends</h2>
        <div class="simple-chart">
          <div class="chart-bars">
            <div class="chart-bar" style="height: 60%">
              <span class="bar-label">Jan</span>
              <span class="bar-value">12</span>
            </div>
            <div class="chart-bar" style="height: 80%">
              <span class="bar-label">Feb</span>
              <span class="bar-value">19</span>
            </div>
            <div class="chart-bar" style="height: 25%">
              <span class="bar-label">Mar</span>
              <span class="bar-value">5</span>
            </div>
            <div class="chart-bar" style="height: 40%">
              <span class="bar-label">Apr</span>
              <span class="bar-value">8</span>
            </div>
            <div class="chart-bar" style="height: 100%">
              <span class="bar-label">May</span>
              <span class="bar-value">23</span>
            </div>
            <div class="chart-bar" style="height: 70%">
              <span class="bar-label">Jun</span>
              <span class="bar-value">15</span>
            </div>
          </div>
        </div>
      </div>
      
      <div class="statistics-summary">

        
        <div class="summary-card">
          <h3>Detection Rate</h3>
          <div class="summary-value">98.2%</div>
        </div>
      </div>
    </div>
  </div>
</div>
